import React from "react";
import { createChatBotMessage } from "react-chatbot-kit";

import LoanOptions from "./components/LoanOptions/LoanOptions";
import Login from "./components/Login/Login";

const config = {
initialMessages: [
    createChatBotMessage("Hi, I'm here to help."),
  ],
  state: {
    userName: ""
  },
  widgets: [
      {
        widgetName: "login",
        widgetFunc: (props) => <Login {...props} />,
        mapStateToProps: ['userName']
      },
      {
     	  widgetName: "loanOptions",
    	  widgetFunc: (props) => <LoanOptions {...props} />,
      },
 ],
}

export default config;
